#!/bin/bash
#  buildDatabaseServer.sh
#  This script installs MySQL, sets a root pw, creates a DB named censusdb, and populates the database with US Census Data
#  It is intended for use with RHEL or SLES guests
#  When executing via the IBM Wave Script Manager, be sure to execute as root
#  Version 1.1
#  Sean Patrick McBride. May 21, 2014

# Check if root
if [ $(whoami) != root ]; then
   echo " Must be root to use."
   exit
fi

# Quit if not RHEL or SLES
if [ $(grep -c -m 1 -i "Red Hat Enterprise Linux Server" /etc/issue) != 1 ]; then
   if [ $(grep -c -m 1 -i "suse" /etc/issue) != 1 ]; then
      echo "This is not a RHEL or SLES guest. Quitting."
      exit
   fi
fi

#Part One: Perform Distro-specific procedures to install MySQL, configure MySQL to start at boot, and start MySQL

#If RHEL, install MySQL using yum, instruct chkconfig to start mysqld at boot, and start mysqld now
if [ $(grep -c -m 1 -i "Red Hat Enterprise Linux Server" /etc/issue) = 1 ]; then
   echo "Red Hat Enterprise Linux Detected."
   echo "Installing MySQL"
   yum -y install mysql-server mysql
   echo "Setting MySQL to start when Linux boots"
   chkconfig mysqld on
   echo "Starting MySQL Daemon"
   /etc/init.d/mysqld start
fi

#If SLES, install MySQL using zypper, instruct chkconfig to start mysql at boot, and start mysql now
if [ $(grep -c -m 1 -i "suse" /etc/issue) = 1 ]; then
   echo "Suse Linux Enterprise Sever Detected."
   echo "Installing MySQL"
   zypper -n in mysql mysql-client
   echo "Setting MySQL to start when Linux boots"
   chkconfig mysql on
   echo "Starting MySQL Daemon"
   touch /var/lib/mysql/.force_upgrade
   rcmysql start   
fi

# Part Three: Set MySQL root user password
echo "Setting MySQL root password"
mysqladmin -u root password census

# Part Four: Create Sample MySQL Database echo "Creating MySQL Data named 'censusdb'"
mysql --user=root --password=census -e "CREATE DATABASE censusdb;"

# Part Five: Make the Sample MySQL Database accessible to the root user from all 192.168.0.0 addresses
echo "Making censusdb accessible to the MySQL root user from all 192.168.0.0 addresses"
mysql -D censusdb --user=root --password=census -e "GRANT ALL ON censusdb.* TO 'root'@'192.168.%' IDENTIFIED BY 'census';"

# Part Six: Create a table in the Sample MySQL Database and populate it with dataecho "Populating Census Database"
mysql --user=root --password=census << EOF
